INSERT INTO `go_quanzi_tiezi` VALUES ('12', '1', '9', '老人站海滨浴场出口处 专撞女子胸部', '<p>【老人站海滨浴场出口处 专撞女子胸部】21日,网友“淮海游子d6qp7”上传了一段视频:一头发花白的老人站在一个海滨浴场的出口处,看似无意的抬起胳膊,不断撞向穿着泳衣走出来的女孩的胸部,而女孩们并未发觉不对</p>', '0', '58', 'N', 'N', '9', '1440340152');
INSERT INTO `go_quanzi_tiezi` VALUES ('13', '2', '10', '原任中共中央副主席、中央顾问委员会委员汪东兴同志，因病医治无效，于2015年8月21日上午5时28分在北京逝世', '&lt;p&gt;汪东兴，1916年1月出生于江西省弋阳县，原中共中央副主席、中顾委委员。1932年加入中国共产党，随后参加了红军，历经长征与抗日战争，从1947\n年开始一直担任毛泽东的警卫，并长期掌管8341部队。1968年起担任中共中央办公厅主任兼中央警卫局党委第一书记，并兼总参谋部警卫局局长，对领导人\n的起居、出行等负责，因此又被称为中南海大内总管，是毛泽东晚年最信任的人之一。是四人帮抓捕行动怀仁堂事变的决策人之一。1955年被授予少将军衔&lt;/p&gt;', '3', '247', 'Y', 'N', '10', '1440340379');
