INSERT INTO `go_quanzi_tiezi` VALUES ('16', '1', '14', '习近平致信祝贺第二十二届国际历史科学大会开幕', '央视网消息 第二十二届国际历史科学大会23日在山东济南开幕。国家主席习近平发来贺信，向会议的召开表示热烈的祝贺，向国际历史学会主席玛丽亚塔·希耶塔拉女士等与会的历史学家表示诚挚的欢迎 习近平在贺信中说，历史研究是一切社会科学的基础，承担着“究天人之际，通古今之变”的使命。重视历史、研究历史、借鉴历史，可以给人类带来很多了解昨天、把握今天、开创明天的智慧。 习近平指出人自古重视历史研究，历来强调以史为鉴，我们的前人留下了浩繁的历史典籍。每个国家、每个民族都有自己的发展历程，应该尊重彼此的选择，加深彼此的了解，以利于共同创造人类更加美好的未来。希望这次大会能够推动各国的历史研究，帮助人们从历史的启迪中更好探寻前进方向', '15', '522', 'Y', 'N', '14', '1440385506');
INSERT INTO `go_quanzi_tiezi` VALUES ('17', '5', '17', '天津港爆炸事故首批101名遇难者名单公布，中国5000多年的文明史，是自强不息的奋斗史', '<p>国务院副总理刘延东在开幕式上宣读了习近平的贺信并致辞。她指出，中国5000多年的文明史，是自强不息的奋斗史、追求和平的发展史、互学互鉴的交流史，\n塑造了融入中华民族血脉的文化基因，形成了当代中国的价值理念、制度选择和发展道路。她希望各国学者交流对话、传承创新，加强国际学术合作，为促进多样文\n明和谐共生作出更大贡献。国际历史学会主席玛利亚塔·希耶塔拉在致辞中表示，本届国际历史科学大会将在促进不同文化的跨国交流中发挥重要作用</p>', '3', '229', 'N', 'N', '17', '1440386193');
